import React, { Component } from "react";
import Games from "./games";

class Players extends Component {
  state = {
    players: [
      {
        id: 1,
        name: "Bibs",
      },
      { id: 2, name: "Vasili" },
      { id: 3, name: "Rami" },
    ],
  };
  render() {
    const { players } = this.state;

    return (
      <Games
        player={players.map((player) => (
          <li key={player.id}>{player.name}</li>
        ))}
      />
    );
  }
}

export default Players;
